define('app/messages', [], function () {
    return {
        getHello: function () {
            return 'Hello World!!';
        }
    };
});
define('print', [], function () {
    return function print(msg) {
        console.log(msg);
    };
});
define('app/main', [
    'app/messages',
    'print'
], function (messages, print) {
    print(messages.getHello());
});
requirejs.config({
    baseUrl: '/assets/lib',
    paths: { app: '/assets/app' }
});
requirejs(['app/main']);
define('app', ['app/main'], function () {
    return;
});